import React, { Component } from "react";
import ReactDOM from "react-dom";
import HomeScreen from "./home_components/HomeScreen";
import Services from "./home_components/Services";
import EMR from "./home_components/EMR";
import PracticeMan from "./home_components/PracticeMan";
import RCMAnalytics from "./home_components/RCMAnalytics";
import PatientApp from "./home_components/PatientApp";
import LetsTalk from "./home_components/LetsTalk";
import ContactUs from "./ContactUsHome";

class Home extends Component {
  constructor(props) {
    super(props);

    this.state = {
      contactUs : this.props.contactUs,
      hand : this.props.contactUs
    }
  }

  render() {
    return (
      <React.Fragment>
        <ContactUs
          classToAdd={this.props.contactUs}
          btnHandler={this.props.toggleContactUs}
        />
        <HomeScreen btnHandler={this.props.toggleContactUs} classToAdd={this.props.homePage}/>
        <Services />
        <EMR />
        <PracticeMan />
        <RCMAnalytics />
        <PatientApp />
        <LetsTalk btnHandler={this.props.toggleContactUs} />
      </React.Fragment>
    );
  }
}

export default Home;
